		"text": "*블라인드 티켓은 한정수량, 한정기간 판매로 준비된 수량 소진시 판매가 마감됩니다.\n\n**티켓 예매 및 취소 문의는 각 판매처 (티켓링크, 네이버)로 문의주시기 바라며, 기타 문의는 JUMF 사무국 (063-220-8221)로 문의주시기 바랍니다.\n\nhttps://t.co/1xnrngf6AF"
